{"flavors": ["Spicy/Herbal", "Pepper", "Pungent"], "name": "Dawgfather OG", "medical": {"Pain": 100.0, "Insomnia": 100.0}, "description": "Dawgfather OG, or simply The Dawgfather, is an indica-dominant hybrid created by AlphaKronik Genes capable of massive plant production and a healthier-than-average yield. With potency floating above 20%, this strain contends well with chronic pain, insomnia, Crohn's, and anxiety. Expect traditional notes of gas/chemicals, Kush, and some funkiness. Dawgfather OG offers a strong buzz with nuance worth exploring.", "image_urls": [], "parents": ["chemdawg", "sin-city-kush"], "negatives": {}, "grow_info": {}, "_id": "dawgfather-og", "type": "hybrid", "image_paths": [], "effects": {"Relaxed": 100.0, "Sleepy": 100.0}}
{"flavors": ["Sweet", "Citrus", "Pine"], "name": "Space Cream", "medical": {"Eye Pressure": 52.8301886792453, "Stress": 79.2452830188679, "Pain": 43.3962264150943, "Depression": 100.0, "Headaches": 32.0754716981132}, "description": "Space Cream by Hotsause Genetics is an indica-dominant hybrid with surprisingly uplifting effects. This strain keeps the consumer alert, but hazy mental effects may make it difficult to articulate that alertness. In a way, it gives your mind couchlock while allowing the body to roam unencumbered. It is ideal for social settings and for patients seeking relief from mild pain, depression, and mood swings. Expect an odor of citrus blossom, pine, and hops which blend into a creamy sweetness on the exhale.", "image_urls": [], "parents": ["space-queen", "timewreck"], "negatives": {"Paranoid": 10.5263157894737, "Dry Eyes": 21.0526315789474, "Headache": 10.5263157894737, "Dry Mouth": 100.0}, "grow_info": {}, "_id": "space-cream", "type": "hybrid", "image_paths": [], "effects": {"Energetic": 42.5531914893617, "Relaxed": 74.468085106383, "Uplifted": 67.0212765957447, "Euphoric": 100.0, "Happy": 72.3404255319149}}
{"flavors": ["Grape"], "name": "Purple People Eater", "medical": {"Stress": 100.0, "Depression": 100.0}, "description": "Purple People Eater is the lanky indica-dominant cross of (Lapis Mnt. Indica x GDP) x (Afghanx Purple Urkle) that has been known to produce green and purple buds that smell pungent and earthy. These multifaceted buds areherbaceous with a flavor of sweet grape. Enjoy this strong sedative at the end of the day to soothe physical discomfort and restlessness.", "image_urls": [], "parents": ["granddaddy-purple", "pure-afghan", "purple-urkle"], "negatives": {}, "grow_info": {}, "_id": "purple-people-eater", "type": "indica", "image_paths": [], "effects": {"Relaxed": 96.0, "Creative": 96.0, "Focused": 96.0, "Euphoric": 96.0, "Uplifted": 100.0}}
{"flavors": ["Diesel", "Pine", "Earthy"], "name": "Sour OG", "medical": {"Lack of Appetite": 45.3665914303803, "Stress": 100.0, "Pain": 81.7276941009806, "Depression": 83.2926410375494, "Headaches": 55.1384080056016}, "description": "Sour OG is a 50/50 hybrid strain that is a real favorite among those who love a balanced sativa/indica buzz. As a cross of two of the most popular and widely available strains in the world (Sour Diesel and OG Kush), Sour OG has been available in clone and seed form for quite some time. Most samples express dense, round, OG Kush-type buds laden with large, sticky trichomes. The odor and taste are usually an equal mix of both parents, with sour lemon, pine, fuel, and a distinct kushy undertone, although some versions have a more fruity profile. Often described as a one-hit-quit strain, Sour OG starts with an energetic head high that gradually gives way to a relaxing body stone.", "image_urls": [], "parents": ["sour-diesel", "og-kush"], "negatives": {"Anxious": 24.7326654532157, "Paranoid": 13.3435670913745, "Dry Eyes": 56.5832746235169, "Dizzy": 70.4630190137164, "Dry Mouth": 100.0}, "grow_info": {"difficulty": "Moderate", "height": ".76-2 m", "yield": "100-250", "flowering": "7-9 wks", "stretch": "100-200%"}, "_id": "sour-og", "type": "hybrid", "image_paths": [], "effects": {"Creative": 54.5464186843398, "Relaxed": 88.6872135652226, "Uplifted": 69.1422522856623, "Euphoric": 90.1211630226986, "Happy": 100.0}}
{"flavors": ["Earthy", "Pine", "Sweet"], "name": "Hell's Angel OG", "medical": {"Stress": 82.1572894000622, "Pain": 100.0, "Inflammation": 72.0547093565433, "Depression": 57.7245881255828, "Nausea": 54.6161019583463}, "description": "Hells Angel OG (also calledBiker's Kush or just Hell's OG)is an indica-dominant hybrid that is said to contain OG Kush and Blackberry genetics. The strains origins are poorly documented, but popular myth will tell you Hell's Angel OG was bred by the biker ruffians themselves in Southern California. If nothing else, we could assume this strain is named after its fierce psychoactive effects that settle in quickly and heavily. Lifting stress from the mind and pain from the body, Hells Angels OG is a therapeutic strain commonly used to treat inflammation, insomnia, and PTSD. Underneath its dominant earthy flavors hides a subtle citrus, candy-like aroma. This hybrid produces large, heavy buds that flower in 8 to 9 weeks indoors while outdoor plants are ready for harvest during the September-October transition.", "image_urls": [], "effects": {"Relaxed": 100.0, "Uplifted": 41.1502546689304, "Sleepy": 57.2792869269949, "Euphoric": 81.5577249575552, "Happy": 70.2037351443124}, "grow_info": {}, "_id": "hells-angel-og", "type": "hybrid", "image_paths": [], "negatives": {"Anxious": 24.2553191489362, "Dry Eyes": 29.7872340425532, "Dizzy": 52.1702127659574, "Headache": 16.1702127659574, "Dry Mouth": 100.0}}
{"flavors": ["Spicy/Herbal", "Honey", "Earthy"], "name": "Allkush", "medical": {"Eye Pressure": 50.0, "Stress": 100.0, "Pain": 50.0}, "description": "Allkush, 2nd prize winner at the 2005 Highlife Cannabis Cup, is a hashy Kush blend bred by Paradise Seeds of Amsterdam. This resinous flower hails from the Hippie Trail that winds through Pakistan and Afghanistan, creating a 75/25indica-dominant strain that soothes without binding the consumer to the couch. With traditional uplifting cerebral elements and a pleasant sedation on the body, Allkush shines on patients seeking relief from sleep disorders, anxiety, and depression.", "image_urls": [], "effects": {"Relaxed": 100.0, "Happy": 50.0, "Sleepy": 50.0, "Uplifted": 50.0}, "grow_info": {}, "_id": "allkush", "type": "indica", "image_paths": [], "negatives": {"Dry Mouth": 33.3333333333333, "Dry Eyes": 100.0}}
{"flavors": ["Berry", "Blueberry", "Blue Cheese"], "name": "Josh D OG", "medical": {"Cramps": 100.0, "Fatigue": 100.0, "Depression": 100.0}, "description": "Josh D OG by Karma Genetics is a handcrafted OG hybrid with a lineage stretching back to Florida, 1991. Josh D and Matt Bubba Berger began developing these genetics in Orlando and helped define the OG culture we know today. This strain is a three deep cross of SFV OG x Triangle Kush x Hells Angels OG and offers consumers relaxing effects with an amplified Kush flavor. This indica-dominant hybrid is euphoric and happy while still saddling consumers with potent mid-level sedation.", "image_urls": [], "parents": ["sfv-og", "triangle-kush", "hells-angel-og"], "negatives": {"Paranoid": 100.0, "Anxious": 100.0}, "grow_info": {}, "_id": "josh-d-og", "type": "indica", "image_paths": [], "effects": {"Aroused": 100.0}}
{"flavors": ["Grape", "Sweet", "Pine"], "name": "Urkle Train Haze", "medical": {"Lack of Appetite": 9.98487140695915, "Stress": 97.5794251134645, "Pain": 100.0, "Depression": 94.4024205748865, "Nausea": 52.4962178517398}, "description": "An Arizona Natural Selectionsoriginal, Urkle Train Haze was created using the genetics of Ghost Train Haze and Purple Urkle. These two parent strains are often described as polar opposites of each other, and yet crossing them yields a pleasantly uplifting and euphoric result. Urkle Train Hazes fragrance and flavor is that of an invigorating sweet, berry, and pine that will linger long after consumption. With predominantly indica effects, this strain holds a feeling of relaxation that will leave you smiling and ready to raid the fridge.", "image_urls": [], "parents": ["ghost-train-haze", "purple-urkle"], "negatives": {"Anxious": 1.42857142857143, "Dry Eyes": 6.07142857142857, "Dizzy": 6.07142857142857, "Dry Mouth": 100.0}, "grow_info": {}, "_id": "urkle-train-haze", "type": "hybrid", "image_paths": [], "effects": {"Relaxed": 62.2535211267606, "Creative": 90.1408450704225, "Uplifted": 54.0845070422535, "Euphoric": 94.6478873239437, "Happy": 100.0}}
