{"flavors": ["Earthy", "Diesel", "Grape"], "name": "False Teeth", "medical": {"Stress": 100.0, "Pain": 66.6666666666667, "Inflammation": 33.3333333333333, "Depression": 33.3333333333333, "Nausea": 66.6666666666667}, "description": "False Teeth is another Dungeons Vault Genetics strain with Grandpa's Breath genes. It combines Candyland V2, which is a cross of Platinum Girl Scout Cookies and Granddaddy Purple, with the pungent terpenes of Grandpas Breath. This indica-dominant hybrid is a prodigious resin producer and emits fruity, earthy sweetness. Although False Teeth yields an average crop, the potent, sticky buds more than make up for its lack of weight. Enjoy this strain into the evening to maximize its relaxing effects.", "image_urls": [], "parents": ["grandpas-breath", "candyland"], "negatives": {}, "grow_info": {}, "_id": "false-teeth", "type": "hybrid", "image_paths": [], "effects": {"Creative": 66.6666666666667, "Relaxed": 100.0, "Tingly": 66.6666666666667, "Euphoric": 66.6666666666667, "Uplifted": 100.0}}
