{"flavors": ["Earthy", "Blueberry", "Sweet"], "name": "Snoop's Dream", "medical": {"Lack of Appetite": 65.7707385735723, "Insomnia": 68.9250026174052, "Stress": 94.2324023126229, "Pain": 79.6738131521701, "Depression": 100.0}, "description": "Snoop Dogg is a hip-hop superstar who has quite a bit of fame in the cannabis community. Given his status, Snoops Dream is a strain that has a big name to live up to and this indica-dominant hybrid does not disappoint. Snoops Dream is a mix of Blue Dream and Master Kush, which are purportedly two of the rappers favorites. Looks-wise, these plants and flowers take after their Blue Dream parent with medium-sized dense buds covered in orange hairs. The taste is where the kush side of this strain shows itself. Sweet blueberry flavors are there with a pine aftertaste that takes over. This hybrid has a strong indica side for sure and may make doing any focused task difficult. Head effects can also be strong, making this a choice that beginners might want to work up to. Tests have shown samples of Snoops Dream have high THC levels ranging between 18 and 22%.", "image_urls": [], "parents": ["blue-dream", "master-kush"], "negatives": {"Dizzy": 16.0952815979852, "Paranoid": 13.8206464037925, "Dry Eyes": 45.3118441519962, "Anxious": 13.6237376854892, "Dry Mouth": 100.0}, "grow_info": {}, "_id": "snoop-s-dream", "type": "hybrid", "image_paths": [], "effects": {"Tingly": 35.0921149130786, "Relaxed": 100.0, "Uplifted": 61.3381764615157, "Euphoric": 84.4973733164201, "Happy": 89.9852376920438}}
