{"flavors": ["Earthy", "Sweet", "Berry"], "name": "Pakistani Chitral Kush", "medical": {"Lack of Appetite": 46.6666666666667, "Pain": 74.2857142857143, "Stress": 100.0, "Muscle Spasms": 50.952380952381, "Insomnia": 95.7142857142857}, "description": "Chitral is a town in Pakistan known for making some of the best hash in the region. Pakistani Chitral Kush, also known as PCK, is a pure indica that is considered a selected landrace, meaning it is an indigenous strain that has been selectively inbred to enhance its characteristics. PCK produces a very colorful phenotype, often earning nicknames like Purple Pakistani or Purple Chitral. This strain is appreciated for its advanced resin production that enables this strain to produce the top-quality concentrates. PCK emits a diverse bouquet of aromas ranging from earthy caramel to sweet notes of fruits and berries. The influence of pure indica genetics creates powerfully relaxing body effects that helps to avoid anxieties and pain, as well as inducing sleep when needed.", "image_urls": [], "effects": {"Relaxed": 100.0, "Uplifted": 53.6880290205562, "Sleepy": 32.8899637243047, "Hungry": 60.0967351874244, "Happy": 83.7968561064087}, "grow_info": {"height": "< .75 m", "yield": "40-99"}, "_id": "pakistani-chitral-kush", "type": "indica", "image_paths": [], "negatives": {"Dizzy": 1.96936542669584, "Dry Eyes": 21.4442013129103, "Headache": 1.96936542669584, "Dry Mouth": 100.0}}
