{"flavors": ["Sweet", "Earthy", "Berry"], "name": "Querkle", "medical": {"Lack of Appetite": 61.9051828931374, "Insomnia": 70.8697093601503, "Stress": 100.0, "Pain": 91.1216709028622, "Depression": 53.0312741739419}, "description": "A cross between Purple Urkle and Space Queen, Querkle from TGA Genetics is an80/20 indica-dominant strain that carries a strong grape and berry aroma. Querkle blooms with vibrant lavender hues and a heavy dusting of crystal resin that blankets its bulky colas in a frost-like coat. Heavily euphoric and cerebral, Querkle may be used during the day but is ideal for evening use as it relaxes muscles andguides the mind into sleep.", "image_urls": [], "parents": ["purple-urkle", "space-queen"], "negatives": {"Anxious": 11.2869546103967, "Dry Eyes": 48.862512363996, "Headache": 20.0736344653259, "Dizzy": 5.00054951093527, "Dry Mouth": 100.0}, "grow_info": {"height": "< .75 m", "yield": "100-250", "flowering": "7-9 wks"}, "_id": "querkle", "type": "indica", "image_paths": [], "effects": {"Relaxed": 100.0, "Uplifted": 66.7406996113271, "Sleepy": 74.6155517466142, "Euphoric": 78.5228013422495, "Happy": 87.2763923424185}}
