{"flavors": ["Earthy", "Grape", "Sweet"], "name": "3X Crazy", "medical": {"Lack of Appetite": 77.2516051222021, "Pain": 89.8939377815615, "Stress": 100.0, "Insomnia": 92.0009932247881, "Depression": 86.7333546167216}, "description": "Also known as Optimus Prime, the indica-dominant 3X Crazy is a three-way cross between OG Kush, Bubba Kush, and Granddaddy Purple. Its aroma is comprised of sweet grape, spicy pepper, and earthy notes passed on by its Bubba Kush parent. This indica will leave you sedated with soothing full-body effects, but not before a brief phase of clear-headed cerebral psychoactivity. The relaxing effects induced by 3X Crazy can be used to treat a variety of severe symptoms, some of which include pain, spasms, tension, and insomnia.", "image_urls": [], "parents": ["og-kush", "bubba-kush", "granddaddy-purple"], "negatives": {"Dizzy": 16.6688438928805, "Anxious": 14.7289353363814, "Paranoid": 7.36446766819072, "Dry Eyes": 58.3344219464402, "Dry Mouth": 100.0}, "grow_info": {}, "_id": "3x-crazy", "type": "indica", "image_paths": [], "effects": {"Creative": 34.4107204469821, "Relaxed": 100.0, "Uplifted": 49.2715393947489, "Euphoric": 42.5400959408773, "Happy": 60.1066257081483}}
