{"flavors": ["Sweet", "Earthy", "Citrus"], "name": "Negra 44", "medical": {"Pain": 100.0, "Lack of Appetite": 100.0, "Muscle Spasms": 100.0, "Insomnia": 100.0, "Headaches": 100.0}, "description": "Negra 44 is an indica-dominant strain bred by R-Kiem Seeds in Spain. This award-winning variety crosses a Top 44 indica with native Ghana landrace strains, and inherits an earthy, fruity aroma. Indoors, Negra 44 flowers in 8 weeks while outdoor gardens are ready for harvest at the end of September. Negra 44 produces dark green buds and has adapted over time to suit Mediterranean climates.", "image_urls": [], "parents": ["african"], "negatives": {}, "grow_info": {}, "_id": "negra-44", "type": "indica", "image_paths": [], "effects": {"Relaxed": 80.0, "Talkative": 40.0, "Energetic": 80.0, "Hungry": 60.0, "Creative": 100.0}}
