{"flavors": ["Pungent", "Grape", "Berry"], "name": "Purple Nepal", "medical": {"Pain": 82.0646506777894, "Stress": 100.0, "Insomnia": 84.8800834202294, "Depression": 48.0709071949948, "Headaches": 52.8675703858186}, "description": "Purple Nepal is a cross between an original Nepalese strain and Lemon Thai. A happy, medium-level indica, this strain will not leave you stuck on the couch but is best used when you are looking to unwind at the end of the day. Sweet and flowery, Purple Nepal has a mellow, earthy grape taste that complements its almost completely purple leaves. This strain is easy to cultivate and typically flowers between 8 and 9 weeks. While it may be grown outdoors with some difficulty, it typically grows best and produces high yields when grown indoors.", "image_urls": [], "effects": {"Relaxed": 100.0, "Uplifted": 58.0454096742349, "Sleepy": 67.8183613030602, "Euphoric": 63.3761105626851, "Happy": 66.9299111549852}, "grow_info": {}, "_id": "purple-nepal", "type": "indica", "image_paths": [], "negatives": {"Dizzy": 4.87540628385699, "Paranoid": 3.90032502708559, "Dry Eyes": 80.3900325027086, "Headache": 3.90032502708559, "Dry Mouth": 100.0}}
{"flavors": ["Grape", "Tropical", "Citrus"], "name": "Monkey Paw", "medical": {"Fatigue": 95.364238410596, "Stress": 66.5562913907285, "Muscle Spasms": 82.4503311258278, "Lack of Appetite": 100.0, "Insomnia": 67.8807947019868}, "description": "Monkey Paw takes its name from its fingerling buds that resemble the curled paws of primates. It is a fabled old school strain whose roots sprouted in Michigan and has built a solid reputation for itself across the Midwest. This hybrid is a compelling mixture of Acapulco Gold and Colombian Gold sativas that are balanced by Afghanis indica influence to produce a pungent combination of sweet and fruity flavors. Its aroma is reminiscent of the thick musk of Skunk varieties with sharp notes of zesty citrus that cut the senses. The aftertaste of fresh fruits, like grape and blueberry, serves as precursor to the relaxing effects that calm body pains and stimulate the stomach.", "image_urls": [], "parents": ["acapulco-gold", "colombian-gold", "afghani"], "negatives": {"Paranoid": 94.9640287769784, "Anxious": 7.19424460431655, "Dry Eyes": 49.1606714628297, "Dizzy": 7.19424460431655, "Dry Mouth": 100.0}, "grow_info": {}, "_id": "monkey-paw", "type": "hybrid", "image_paths": [], "effects": {"Relaxed": 100.0, "Uplifted": 55.8730158730159, "Focused": 56.8253968253968, "Hungry": 70.6878306878307, "Happy": 95.3439153439153}}
{"flavors": ["Sweet", "Strawberry", "Citrus"], "name": "Doctor Doctor", "medical": {"Nausea": 100.0, "Muscle Spasms": 100.0, "Pain": 100.0, "Inflammation": 100.0, "Headaches": 100.0}, "description": "Doctor Doctor by Vodis USA is a high-CBD sativa-dominant phenotype of the landrace Malawi. This cannabinoid power plant has been known to generate over 20% CBD and approximately 1-2.5% THC. With this medicinal ratio, Doctor Doctor provides potent wellness driven effects that settle nausea, reduce inflammation, and abate anxiety all while preserving mental clarity. Overall, Doctor Doctor is the perfect choice for consumers seeking a smooth, flavorful smoke with the potential to ease both physical and mental stresses.", "image_urls": [], "parents": ["malawi"], "negatives": {"Dry Eyes": 100.0}, "grow_info": {}, "_id": "doctor-doctor", "type": "sativa", "image_paths": [], "effects": {"Tingly": 80.0, "Relaxed": 100.0, "Happy": 90.0, "Focused": 90.0, "Uplifted": 90.0}}
{"flavors": ["Berry", "Earthy", "Pungent"], "name": "Blackwater", "medical": {"Insomnia": 65.1882897717983, "Stress": 73.0429425641744, "Pain": 100.0, "Depression": 56.5692663443347, "Nausea": 55.2018370588373}, "description": "Blackwater is an indica strain typically bred from Mendo Purps and San Fernando Valley OG Kush. Its round, compact buds take on a deep purple color and a sweet grape aroma that blends with subtle undertones of lemon and pine. What begins as a mellow and euphoric cerebral experience melts down to the rest of the body in a head-to-toe euphoric calm that relieves stress and anxiety. Patients have also reported its success in treating pain, appetite loss, and multiple sclerosis. This strain is recommended for late-night consumption as it can cause mental cloudiness and detract from productivity. Blackwater has a flowering time of 8 to 10 weeks and produces moderate yields in indoor, outdoor, and greenhouse gardens. The 2014 Los Angeles Cannabis Cup awarded Blackwater 3rd place in the indica category.", "image_urls": [], "parents": ["mendocino-purps", "sfv-og-kush"], "negatives": {"Dizzy": 11.8929520905761, "Paranoid": 5.52138913160683, "Dry Eyes": 59.1498261726375, "Headache": 5.66993251408281, "Dry Mouth": 100.0}, "grow_info": {}, "_id": "blackwater", "type": "indica", "image_paths": [], "effects": {"Relaxed": 100.0, "Uplifted": 33.3937049918462, "Sleepy": 73.5908569408165, "Euphoric": 51.5134104454995, "Happy": 42.4588342256794}}
{"flavors": ["Pine", "Pepper", "Lavender"], "name": "Purple Bud", "medical": {"Stress": 100.0, "Muscle Spasms": 72.9166666666667, "Pain": 72.9166666666667, "Depression": 100.0, "Headaches": 72.9166666666667}, "description": "From Sensi Seeds comes the purple-blossomed indica Purple Bud, appropriately named for its bright hues of lavender. A descendant of Afghani indicas, this colorful plant offers large harvests of sparkling buds that carry the sweet and piney aroma of sandalwood. A distant sativa relative from Jamaica gives this strain a little added height and cerebral invigoration, but Purple Buds effects generally fall heavy on both mind and body. After crossing the Afghani indicas with a Jamaican sativa, Sensi Seeds added genetics from a Dutch Hindu Kush and a California Purple Kush.", "image_urls": [], "parents": ["afghani", "jamaican", "hindu-skunk", "purple-kush"], "negatives": {"Dizzy": 61.4035087719298, "Dry Mouth": 80.7017543859649, "Dry Eyes": 100.0}, "grow_info": {"height": "< .75 m", "yield": "251-500", "flowering": "7-9 wks"}, "_id": "purple-bud", "type": "indica", "image_paths": [], "effects": {"Focused": 33.3333333333333, "Relaxed": 100.0, "Sleepy": 71.9047619047619, "Euphoric": 60.4761904761905, "Happy": 65.7142857142857}}
